import StaysData from '../../stays.json'

export default function StaysList() {
    const data = StaysData;
    // const city = 'Helsinki'
    const listItems = data.forEach( data => 
        <li key = {data.city}>
            <div className="Stays">
                <img src={data.photo} className="Stay-picture" alt="Stay Picture" />
                    <div className="Stay-Features">
                        <p>{data.superHost}</p>
                        <p>{data.type}</p>
                        <p>{data.beds}</p>
                        <p>{data.rating}</p>
                    </div>
                <p>{data.title}</p>
            </div>
        </li>);
    console.log(listItems);
    return (
        <section>
            <h1>Stays in {data.country}</h1>
            <ul>{listItems}</ul>
        </section>
    )
  }
